import React from "react";
import "./style.css"


function Search(props) {
  return (
    <div className="backgroundRow p-5 m-5">
      <div className="container my-4">
        <div className="row">
          <div className="col-md-2">
          </div>
          <div className="col-md-8">
            <form>
              <input id="search" class="form-control" type="text" placeholder="Search"></input>
              <button type="submit" class="btn btn-secondary btn-md btn-block" onClick={() => this.searchDatabase(document.getElementById("search").value)}>Search</button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}
export default Search;
